/** @jsx jsx */
import { jsx, css } from '@emotion/core';
import React from 'react';

import Layout from '../components/Layout';
const styles = css`
  h2 {
    text-align: center;
    font-size: 40px;
  }
  p {
    text-align: center;
    width: 50px;
  }
`;

function Home() {
  return (
    <Layout>
      <h1>Megan Liles</h1>
      <div>
        <h2>Welcome to my Website! Feel free to look around and check out my resume and github projects!</h2>
        <img></img>
        <p>I am currently actively looking for full time positions in the Computer Science world as a Web Developer, Software Engineer, Mobile App Developer or anything in the UX industry! I will be graduating June 2020 from Oregon State University with a Bachelor's in Computer Science.</p>
      </div>
    </Layout>
  );
}

export default Home;
